package com.project.spring.core.ci.collections2;

public class Year {
	private int year;

	public Year() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Year(int year) {
		super();
		this.year = year;
	}

	@Override
	public String toString() {
		return String.format("Year [year=%s]", year);
	}
	
}
